// src/icons.js
import { library } from '@fortawesome/fontawesome-svg-core';
import { 
    faPhone, faEnvelope, faUser, 
    faUpload, faIdCard, faCalendar, 
    faArrowLeft, faArrowRight,faHandPointRight,
    faShieldAlt, faUserShield, faExclamationCircle
} from '@fortawesome/free-solid-svg-icons';

library.add(
    faPhone, faEnvelope, faUser, 
    faUpload, faIdCard,faCalendar, 
    faArrowLeft, faArrowRight,
    faShieldAlt, faUserShield, faExclamationCircle
);
